import styles from '../styles/App.module.css';

const Footer = () => {
  return (
    <footer id="contact" className={styles.footer}>
      <p>At HypertechGames Studio, we don't just create games—we build long-term partnerships that bring fun, innovation, and revenue together.</p>
      <p>© 2024 HypertechGames Studio. All Rights Reserved.</p>
    </footer>
  );
};

export default Footer;
